import "./AboutSub4.css";

function AboutSub4() {
  return (
    <>
      <div className="mainAboutSub4">
      <div className="vloggers">
        <p className="vloggersHeading">Our Hotel YouTube Refereces...!</p>
        <div className="vloggersPhoto">

        </div>
      </div>
      </div>
    </>
  );
}

export default AboutSub4;
